import React from "react";
import "./index.css";

const App = () => {
  const inputEvent = () => {
    console.log("hogaya");
  };

  return (
    <>
      <div>
        <h1>Hello</h1>
        <input
          type="number"
          pattern="[0-9]*"
          maxLength="s"
          placeholder="Enter Your Age"
          onChange={inputEvent}
        />
        <button>Find Age</button>
      </div>
    </>
  );
};

export default App;
